import React from "react";
import { LayoutDashboard, Users } from "lucide-react";

function SideBar() {
  return (
    <div className="bg-light flex h-screen">
      <div className="fixed inset-y-0 left-0 z-30 bg-main shadow-lg transform transition-transform duration-300 ease-in-out">
        <div className="flex items-center justify-between p-6 bg-secondary text-light">
          <LayoutDashboard size={20} />
        </div>
        <nav className="mt-6 space-y-1 max-h-[29rem]">
            <a href=""></a>
        </nav>
      </div>
    </div>
  );
}

export default SideBar;
